import React from 'react'
import {Container} from '../components/Styles/Container/Container.style.js'
import {Header, MainHeader} from '../components/Styles/Header/Header.styled.js';

import { Icon, Divider } from 'semantic-ui-react';

import Comments from './components/comment.js';

const Home = () => {
  return (
    <div>
    <Container>
      <Header>
        <MainHeader>
          <h1>This is my portfolio</h1>
        </MainHeader>
      </Header>
    </Container>

    <Divider horizontal>
      <Header as = "h4">
        <Icon name = "comment alternate" style = {{color: "white"}}/>
        후기를 남겨주세요
      </Header>
    </Divider>
    <Comments/>
    </div>
  )
}

export default Home;
